    const imageSrc = require(image)
    return(
        <a href="https://www.linkedin.com/in/noppakun-anantakitthawon-67b96a183/"><img className="contact-logo-button" src={require("../assets/images/LinkedIn_icon.png")} alt="Linkedin logo" /></a>
    )
}

